CREATE DEFINER=`root`@`localhost` PROCEDURE `AmountPurchased`(IN Usuario VARCHAR(255), IN id_coinP VARCHAR(255), IN Print BOOL, OUT AmountPurchased DECIMAL(18,8))
BEGIN
		SET AmountPurchased = (SELECT Invested/Previous_Quotation AS AmountPurchased
								FROM users_cryptocoin
								WHERE id_CryptoCoin = (SELECT ID_CryptoCoin
																		FROM CryptoCoin
																		WHERE id_Coin = id_coinP
																		LIMIT 1));
		IF Print THEN
			SELECT AmountPurchased;
		END IF;
	END ;;
