DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `Change24`(IN Usuario VARCHAR(255), IN id_coinP VARCHAR(255), IN Print BOOL, OUT Change24 VARCHAR(255))
BEGIN
		 #concat (Price change percentage 24h (API)) %
         
        #Calcular el procentaje de cambio en 24 horas al checar el ultimo y penultimo precio en la columna 
        #ClosePrice en la tabla crypto_historic en base a la moneda de id_coin y la columna id_CryptoCoin

        DECLARE ID_Moneda VARCHAR(255);
        SET ID_Moneda = (SELECT ID_CryptoCoin FROM cryptocoin WHERE id_coin = id_coinP);
        SELECT 
            CONCAT(
                ROUND((
                    (SELECT ClosePrice FROM crypto_historic WHERE id_CryptoCoin = ID_Moneda ORDER BY DateHistoric DESC LIMIT 1) -
                    (SELECT ClosePrice FROM crypto_historic WHERE id_CryptoCoin = ID_Moneda ORDER BY DateHistoric DESC LIMIT 1, 1)
                ) / 
                (SELECT ClosePrice FROM crypto_historic WHERE id_CryptoCoin = ID_Moneda ORDER BY DateHistoric DESC LIMIT 1) * 100, 
                8
            ), '%') INTO Change24;

        IF Print THEN
            SELECT Change24;
        END IF;

    END ;;
DELIMITER ;
