DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `DailyReturn`(IN Usuario VARCHAR(255), IN id_coinP VARCHAR(255), IN Print BOOL, OUT DailyReturn VARCHAR(255))
BEGIN
		 #ROI / (valuation date – purchased date)

         DECLARE ValuationDate DATE; 
         DECLARE PurchasedDate DATE;
		 DECLARE ROI DECIMAL(10,8);
         SET ValuationDate = (SELECT MAX(DateHistoric) 
                                        FROM crypto_historic 
                                        WHERE id_CryptoCoin = (SELECT ID_CryptoCoin 
                                                                FROM cryptocoin 
                                                                WHERE id_Coin = id_coinP));
         SET PurchasedDate = (SELECT Purchase_Date 
                                        FROM users_cryptocoin 
                                        WHERE id_Users = (SELECT ID_Users
                                                        FROM users
                                                        WHERE Email = Usuario)
                                        AND id_CryptoCoin = (SELECT ID_CryptoCoin 
                                                             FROM cryptocoin 
                                                             WHERE id_Coin = id_coinP));
        CALL ROI(Usuario, id_coinP, FALSE, ROI);
        SET DailyReturn = ROI/(DATEDIFF(ValuationDate, PurchasedDate));
       

        IF Print THEN
            SELECT DailyReturn;
        END IF;
    END ;;
DELIMITER ;
