CREATE DEFINER=`root`@`localhost` PROCEDURE `EliminarUsuario`(IN Correo VARCHAR(255))
BEGIN
    DECLARE UsuarioID INT;

    SELECT ID_Users INTO UsuarioID FROM users WHERE Email = Correo;

    IF UsuarioID IS NOT NULL THEN
        DELETE FROM users WHERE ID_Users = UsuarioID;
        SELECT 'Usuario eliminado correctamente.' AS mensaje;
    ELSE
        SELECT 'No se encontró un usuario con ese correo electrónico.' AS mensaje;
    END IF;
END ;;
