            (SELECT ID_CryptoCoin FROM cryptocoin WHERE id_Coin = id_coinP LIMIT 1),
            cantidadAComprar,
            (SELECT ClosePrice FROM crypto_historic WHERE id_CryptoCoin = (SELECT ID_CryptoCoin FROM cryptocoin WHERE id_Coin = id_coinP LIMIT 1) AND DateHistoric = '2025-03-01' LIMIT 1),
            (SELECT DateHistoric FROM crypto_historic WHERE id_CryptoCoin = (SELECT ID_CryptoCoin FROM cryptocoin WHERE id_Coin = id_coinP LIMIT 1) AND DateHistoric = '2025-03-01' LIMIT 1)
            );
