CREATE DEFINER=`root`@`localhost` PROCEDURE `Portafolio`(IN Usuario VARCHAR(255))
BEGIN
	DECLARE Monedas INT;
    DECLARE Currency1 varchar(255);
    DECLARE Symbol varchar(255);
    DECLARE AmountPurchased DECIMAL(18,8);
    DECLARE Ponderaciones VARCHAR(255);
    DECLARE PreviousQuotation DECIMAL(18,8);
    DECLARE TotalInvested DECIMAL(18,8);
    DECLARE PortafolioCurrentValue DECIMAL(18,8);
    DECLARE ProfitLoss DECIMAL(18,8);
    DECLARE ROI DECIMAL(18,8);
    DECLARE Change24 VARCHAR(255);
    DECLARE CurrentPrice DECIMAL(18,8);
    DECLARE DailyReturn DECIMAL(18,8);
    DECLARE ID_Usuario INT;
    DECLARE Contador INT;
    
    SET ID_Usuario = (SELECT ID_Users 
					  FROM users 
					  WHERE Email = Usuario);
    
    DROP TEMPORARY TABLE IF EXISTS MonedasLista;
    CREATE TEMPORARY TABLE IF NOT EXISTS MonedasLista(
        ID INT AUTO_INCREMENT PRIMARY KEY,
        id_Coin VARCHAR(255)
    ); 

    DROP TEMPORARY TABLE IF EXISTS Portafolio;
    CREATE TEMPORARY TABLE Portafolio(
    NUMERO INT,
    CURRENCY VARCHAR(255),
    SYMBOL VARCHAR(255),
    AMOUNT_PURCHASED DECIMAL(18,8),
    PONDERACIONES VARCHAR(255),
    PREVIOUS_QUOTATION DECIMAL(18,8),
    TOTAL_INVESTED DECIMAL(18,8),
    PORTAFOLIO_CURRENT_VALUE DECIMAL(18,8),
    PROFIT_LOSS DECIMAL(18,8),
    ROI DECIMAL(18,8),
    CHANGE_24 VARCHAR(255),
    CURRENT_PRICE DECIMAL(18,8),
    DAILY_RETURN DECIMAL(18,8)
	);

    SET Contador = 1;

    
    SET Monedas = (SELECT COUNT(*) 
					FROM users_cryptocoin 
					WHERE id_Users = ID_Usuario);


    INSERT INTO MonedasLista(id_Coin)
    SELECT c.id_Coin
    FROM users_cryptocoin uc
    JOIN cryptocoin c ON uc.id_CryptoCoin = c.ID_CryptoCoin
    WHERE id_Users = ID_Usuario;


    WHILE Contador <= Monedas DO
        SET Currency1 = (SELECT id_Coin
                        FROM MonedasLista 
                        WHERE ID = Contador);
        SET Symbol = (SELECT Symbol
                        FROM cryptocoin 
                        WHERE id_Coin = Currency1);
        CALL AmountPurchased(Usuario, Currency1, FALSE, AmountPurchased);
        CALL Ponderacion(Usuario, Currency1, FALSE, Ponderaciones);

        SET PreviousQuotation = (SELECT Previous_Quotation
                                FROM users_cryptocoin 
                                WHERE id_Users = ID_Usuario
                                AND id_CryptoCoin = (SELECT ID_CryptoCoin
													FROM cryptocoin 
													WHERE id_Coin = Currency1));
        SET TotalInvested = (SELECT Invested
                                FROM users_cryptocoin 
                                WHERE id_Users = ID_Usuario
                                AND id_CryptoCoin = (SELECT ID_CryptoCoin
													FROM cryptocoin 
													WHERE id_Coin = Currency1));
        CALL PortfolioCurrentValue(Usuario, Currency1, FALSE, PortafolioCurrentValue);
        CALL ProfitLoss(Usuario, Currency1, FALSE, ProfitLoss);
        CALL ROI(Usuario, Currency1, FALSE, ROI);
        CALL Change24(Usuario, Currency1, FALSE, Change24);
        SET CurrentPrice = (SELECT ClosePrice
                            FROM Crypto_historic
                            WHERE id_CryptoCoin = (SELECT ID_CryptoCoin
													FROM cryptocoin 
													WHERE id_Coin = Currency1) 
                            ORDER BY DateHistoric DESC
                            LIMIT 1);
        CALL DailyReturn(Usuario, Currency1, FALSE, DailyReturn);
        INSERT INTO Portafolio
        VALUES(
            Contador,
            Currency1,
            Symbol,
            AmountPurchased,
            Ponderaciones,
            PreviousQuotation,
            TotalInvested,
            PortafolioCurrentValue,
            ProfitLoss,
            ROI,
            Change24,
            CurrentPrice,
            DailyReturn
        );
        SET Contador = Contador + 1;
    END WHILE;
    SELECT * FROM Portafolio;
END ;;
DELIMITER ;
