CREATE DEFINER=`root`@`localhost` PROCEDURE `PortfolioCurrentValue`(IN Usuario VARCHAR(255), IN id_coinP VARCHAR(255), IN Print BOOL, OUT PortfolioCurrentValue DECIMAL(18,8))
BEGIN
		#Amount purchased * CurrentPrice
        DECLARE PrecioActual DECIMAL(18,8);
        DECLARE CantidadComprada DECIMAL(18,8);
        CALL AmountPurchased(Usuario, id_coinP, FALSE, CantidadComprada);
		SET PrecioActual = (SELECT
								ClosePrice
							FROM 
								crypto_historic
							WHERE id_CryptoCoin = (SELECT ID_CryptoCoin 
													FROM cryptocoin
													WHERE id_Coin = id_coinP
													LIMIT 1)
							ORDER BY DateHistoric DESC
							LIMIT 1);
		SET PortfolioCurrentValue =  PrecioActual * CantidadComprada;
		IF Print THEN
			SELECT PortfolioCurrentValue;
		END IF;
    END ;;
DELIMITER ;
