CREATE DEFINER=`root`@`localhost` PROCEDURE `ProfitLoss`(IN Usuario VARCHAR(255), IN id_coinP VARCHAR(255), IN Print BOOL, OUT ProfitLoss DECIMAL(18,8))
BEGIN
		#Current value - TotalInvested
        DECLARE ValorActual DECIMAL(18,8);
        DECLARE TotalInvested DECIMAL(18,8);
        
        CALL PortfolioCurrentValue(Usuario, id_coinP, FALSE, ValorActual);
                            
		SET TotalInvested = (SELECT
									Invested
								FROM users_cryptocoin
                                WHERE id_Users = (SELECT ID_Users 
													FROM users
													WHERE Email = Usuario
													LIMIT 1)
								AND id_CryptoCoin = (SELECT ID_CryptoCoin 
													FROM cryptocoin
													WHERE id_Coin = id_coinP
													LIMIT 1));
		SET ProfitLoss = ValorActual - TotalInvested;
		IF Print THEN
        	SELECT ProfitLoss;
		END IF;
    END ;;
