CREATE DEFINER=`root`@`localhost` PROCEDURE `ROI`(IN Usuario VARCHAR(255), IN id_coinP VARCHAR(255), IN Print BOOL, OUT ROI DECIMAL(18,8))
BEGIN
		#(Profit/loss) / total invested
        
        DECLARE ProfitLoss DECIMAL(18,8);
        DECLARE TotalInvested DECIMAL(18,8);
        
        CALL ProfitLoss(Usuario, id_coinP, FALSE, ProfitLoss);
        
        SET TotalInvested = (SELECT Invested
							FROM users_cryptocoin
                            WHERE id_Users = (SELECT ID_Users
												FROM users
                                                WHERE Email = Usuario)
							AND id_CryptoCoin = (SELECT ID_CryptoCoin
												FROM cryptocoin
                                                WHERE id_Coin = id_coinP
                                                LIMIT 1)
                            LIMIT 1);
        SET ROI = ProfitLoss / TotalInvested;
        IF Print THEN
            SELECT ROI;
        END IF;
    END ;;
DELIMITER ;
